int main(void){
  PLL_Init(Bus80MHz);       // Bus clock is 80 MHz 
  //Random_Init(1);
	DisableInterrupts();			//disable interrupts during setup
	ADC_Init();
	DAC_Init();
	PortE_Init();
	Timer0_Init(GetADC, 1333333);		//run ADC sample at 60Hz
	SysTick_Init();									//run DAC output at 40MHz
	ST7735_InitR(INITR_REDTAB);
	EnableInterrupts();
	ST7735_FillScreen(0);
	int input = 0;
  while(1){
		OutputNextState();						//Output FSM State
		
		if ((GPIO_PORTE_DATA_R&0x07) != 0){		//wait for button press and release (so states don't keep changing)
			input = GPIO_PORTE_DATA_R & 0x07;
			while ((GPIO_PORTE_DATA_R&0x07) !=0){}
		}
		else
			input = 0;
		
		currentState = FSM[currentState].nextState[input];	//get next state
	}
}




void OutputNextState(void){
	if ((currentState == MainMenu) && (currentState!= prevState)){
		prevState = MainMenu; 	//recognize output
		//ST7735_SetCursor(0,0);
		//ST7735_FillScreen(0);
		//ST7735_OutString("Welcome to:\n\n'Tanks!'\nSniper Shootout\n\nFirst player to get\n a direct hit wins!\n\nPress any button");
		ST7735_DrawBitmap(0, 159, Intro, 128, 160);
		TanksReset();
		angle1=45;
		angle2=45;
		power1=50;
		power2=50;
		currentSound = fanfare;
		length = 12776;
		dacIndex = 0;
	}
	
	if ((currentState == FireSelect1) && (currentState!= prevState)){
		if ((prevState == MainMenu) || (prevState == Fire2)){
			ST7735_DrawBitmap(0, 159, Mountain, 128, 160);
			Tank1Print();
			Tank2Print();
			PrintButtonMenu();
			PrintPlayer1Turn();
		}
		prevState = FireSelect1; 	//recognize output
		ReturnArrow(0);
		currentSound = select;
		length = 933;
		dacIndex = 0;
	}
	
	if ((currentState == AngleSelect1) && (currentState!= prevState)){
		if (prevState == AngleEdit1){
			PrintButtonMenu();
			angle1 = ADC_Mailbox*10/455;
			if (angle1 == 0)
				angle1 = 1;
		}
		prevState = AngleSelect1; 	//recognize output
		ReturnArrow(1);
		currentSound = select;
		length = 933;
		dacIndex = 0;
	}
	
	if ((currentState == PowerSelect1) && (currentState!= prevState)){
		if (prevState == PowerEdit1){
			PrintButtonMenu();
			power1= ADC_Mailbox*100/4095;
		}
		prevState = PowerSelect1; 	//recognize output
		ReturnArrow(2);
		currentSound = select;
		length = 933;
		dacIndex = 0;
	}
	
	if ((currentState == MoveSelect1) && (currentState!= prevState)){
		if (prevState == Move1){
			PrintButtonMenu();
		}
		prevState = MoveSelect1; 	//recognize output
		ReturnArrow(3);
		currentSound = select;
		length = 933;
		dacIndex = 0;
	}
	
	if (currentState == PowerEdit1){
		if (currentState!=prevState){
			PrintPowerMenu();
		}
		prevState = PowerEdit1; 	//recognize output
		SliderMoveArrow(ADC_Mailbox);
	}
	
	if (currentState == AngleEdit1){
		if (currentState!=prevState){
			PrintAngleMenu();
		}
		prevState = AngleEdit1; 	//recognize output
		SliderMoveArrow(ADC_Mailbox);
	}
	
	if (currentState == Move1){
		prevState = Move1;
		PrintMoveMenu();
		while ((GPIO_PORTE_DATA_R & 0x07)!= 0){};		//wait for release
		while ((GPIO_PORTE_DATA_R & 0x07)==0){};		//wait for press
		int input = GPIO_PORTE_DATA_R & 0x07;
		currentSound = tankmove;
		length = 6145;
		dacIndex = 0;
		if ((input & 0x01)>0){
			Tank1MoveRight();
		}
		if ((input & 0x04)>0){
			Tank1MoveLeft();
		}
		Delay100ms(5);
	}
	
	if (currentState == Fire1){
		prevState = Fire1;
		ClearMenu();
		PrintDeleteTurn();
		currentSound = cannon;
		length = 5408;
		dacIndex = 0;
		int hit = Player1Fire(power1, angle1);
		currentSound = bulletimpact;
		length = 2115;
		dacIndex = 0;
		Delay100ms(10);
		if (hit > 0)
			currentState = GameOver;
	}
	
	if ((currentState == FireSelect2) && (currentState!= prevState)){
		if ((prevState == MainMenu) || (prevState == Fire1)){
			ST7735_DrawBitmap(0, 159, Mountain, 128, 160);
			Tank1Print();
			Tank2Print();
			PrintButtonMenu();
			PrintPlayer2Turn();
		}
		prevState = FireSelect2; 	//recognize output
		ReturnArrow(0);
		currentSound = select;
		length = 933;
		dacIndex = 0;
	}
	
	if ((currentState == AngleSelect2) && (currentState!= prevState)){
		if (prevState == AngleEdit2){
			PrintButtonMenu();
			angle2 = ADC_Mailbox*10/455;
			if (angle2 == 0)
				angle2 = 1;
		}
		prevState = AngleSelect2; 	//recognize output
		ReturnArrow(1);
		currentSound = select;
		length = 933;
		dacIndex = 0;
	}
	
	if ((currentState == PowerSelect2) && (currentState!= prevState)){
		if (prevState == PowerEdit2){
			PrintButtonMenu();
			power2= ADC_Mailbox*100/4095;
		}
		prevState = PowerSelect2; 	//recognize output
		ReturnArrow(2);
		currentSound = select;
		length = 933;
		dacIndex = 0;
	}
	
	if ((currentState == MoveSelect2) && (currentState!= prevState)){
		if (prevState == Move2){
			PrintButtonMenu();
		}
		prevState = MoveSelect2; 	//recognize output
		ReturnArrow(3);
		currentSound = select;
		length = 933;
		dacIndex = 0;
	}
	
	if (currentState == PowerEdit2){
		if (currentState!=prevState){
			PrintPowerMenu();
		}
		prevState = PowerEdit2; 	//recognize output
		SliderMoveArrow(ADC_Mailbox);
	}
	
	if (currentState == AngleEdit2){
		if (currentState!=prevState){
			PrintAngleMenu();
		}
		prevState = AngleEdit2; 	//recognize output
		SliderMoveArrow(ADC_Mailbox);
	}
	
	if (currentState == Move2){
		prevState = Move2;
		PrintMoveMenu();
		while ((GPIO_PORTE_DATA_R & 0x07)!= 0){};		//wait for release
		while ((GPIO_PORTE_DATA_R & 0x07)==0){};		//wait for press
		int input = GPIO_PORTE_DATA_R & 0x07;
		currentSound = tankmove;
		length = 6145;
		dacIndex = 0;
		if ((input & 0x01)>0){
			Tank2MoveRight();
		}
		if ((input & 0x04)>0){
			Tank2MoveLeft();
		}
		Delay100ms(5);
	}
	
	if (currentState == Fire2){
		prevState = Fire2;
		ClearMenu();
		PrintDeleteTurn();
		currentSound = cannon;
		length = 5408;
		dacIndex = 0;
		int hit = Player2Fire(power2, angle2);
		currentSound = bulletimpact;
		length = 2115;
		dacIndex = 0;
		Delay100ms(10);
		if (hit > 0)
			currentState = GameOver2;
	}
	
	if (currentState == GameOver && prevState!=currentState){
		prevState = GameOver; 	//recognize output
		//ST7735_DrawBitmap(0, 159, Over, 128, 160);
		ST7735_SetCursor(0,0);
		ST7735_FillScreen(0);
		p1score++;
		ST7735_OutString("Game Over!\nScores:\nPlayer1\n");
		LCD_OutDec(p1score);
		ST7735_OutString("\nPlayer2\n");
		LCD_OutDec(p2score);
		ST7735_OutString("\nPlay Again?");
		TanksReset();
	}
	if (currentState == GameOver2 && prevState!=currentState){
		prevState = GameOver2; 	//recognize output
		//ST7735_DrawBitmap(0, 159, Over, 128, 160);
		ST7735_SetCursor(0,0);
		ST7735_FillScreen(0);
		p2score++;
		ST7735_OutString("Game Over!\nScores:\nPlayer1\n");
		LCD_OutDec(p1score);
		ST7735_OutString("\nPlayer2\n");
		LCD_OutDec(p2score);
		ST7735_OutString(" \nPlay Again?");
		TanksReset();
	}
}






void SysTick_Init(void){
	NVIC_ST_CTRL_R = 0; 
  NVIC_ST_RELOAD_R = 20000;		//40khz
  NVIC_ST_CURRENT_R = 0;
  NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R&0x00FFFFFF)|0x20000000; // priority 1          
  NVIC_ST_CTRL_R = 0x07; // enable SysTick with interrupts
}

void SysTick_Handler(void){
	if (dacIndex<length){
		DAC_Out(currentSound[dacIndex]);		//sound output
		dacIndex++;
	}
	else{
		currentSound = cannon;
		length = 1;
		dacIndex = 0;					//output silence
	}
}


int abv(int x){		//helper function
	if (x<0)
		return x*-1;
	return x;
}


void GetADC(void){		//sample ADC every 60Hz, put in mailbox (passed to timer 0)
	int temp = ADC_In();
	int compare = abv(temp-ADC_Mailbox);
	if (compare > 0x30){
		ADC_Mailbox = temp;
	}
}

void PortE_Init(void){
	int portDelay = 0;
	SYSCTL_RCGCGPIO_R |= 0x10;
	portDelay++;
	portDelay++;
	GPIO_PORTE_DIR_R &= ~0x07;
  GPIO_PORTE_DEN_R |= 0x0F;
}

